import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import './Terms.css';

function Terms() {
  return (
    <div className="terms">
      <Header />
      <main>
        <h1>Terms of Use</h1>
        <p>Read the terms of use for StreamFlix services.</p>
      </main>
      <Footer />
    </div>
  );
}

export default Terms;
